    UI --> Firebase`,diagramSvg:"/assets/diagrams/rock-buddy.svg",caseStudy:{technicalDetails:"Full-stack music discovery app with React + Redux frontend, Node/Express backend and Redis caching. Integrates Spotify APIs for playback and metadata and Ticketmaster for events. Supports user profiles backed by Firebase.",techStack:["React","Redux","Express","Node.js","Firebase","Redis","Spotify API","Ticketmaster API"],architectureAndProcess:"The project was built with a clear separation: client (React) and API (Express). The backend abstracts external API calls, applies caching via Redis, and supplies consolidated endpoints. Frontend uses Redux for predictable state management and integrates playback and user account features.",systemArchitecture:"Client  Backend (Express)  External APIs (Spotify/Ticketmaster) with Redis caching layer for repeated requests. Firebase for user auth and profile storage, media streaming via Spotify where permitted.",problem:"Music fans want an app to explore, preview, and manage rock content without juggling multiple platforms. Rock Buddy consolidates search, previews, and event discovery into one focused app.",challengesAndSolutions:"Integrating multiple third-party APIs (Spotify, Ticketmaster) required robust error handling and caching to avoid rate limits. The solution included server-side caching (Redis), graceful fallbacks when an API returns partial data, and using a combined API layer to simplify frontend calls."}},{title:"Memory Match",image:"https://opengraph.githubassets.com/1/hppanpaliya/Memory-Match",description:"An engaging memory game featuring card matching, move tracking, timer, and immersive audio effects.",skills:["React.js","Game Logic","CSS3","Audio API"],github:"https://github.com/hppanpaliya/Memory-Match",demo:null,diagram:`graph TD
